import React from 'react';

import { NotificationsNone, Settings } from '@mui/icons-material';

const UserNavbar = () => {
  return (
    <nav className="bg-nav-gray sticky top-0 z-50">
      <div className="container mx-auto p-3 flex items-center justify-between">
       
       <div className="flex items-center space-x-4">
         <div className="relative cursor-pointer text-gray-500 topbarIconContainer">
        <NotificationsNone className="h-6 w-6" />
         <span className="absolute top-0 right-0 w-3 h-3 bg-red-500 text-white rounded-full flex items-center justify-center text-xs topIconBadge">2</span>
       </div>
       <div className="relative cursor-pointer text-gray-500">
        <Settings className="h-6 w-6" />
       </div>
      
</div>




      </div>
    </nav>
  );
};

export default UserNavbar;
